def productExceptSelf(nums: list[int]) -> list[int]:
    L,R,ans = [0]*len(nums),[0]*len(nums),[0]*len(nums)
    L[0] = 1
    for i in range(1, len(nums)):
        L[i] = nums[i - 1] * L[i - 1]
    R[len(nums) - 1] = 1
    for i in reversed(range(len(nums) - 1)):
        R[i] = nums[i + 1] * R[i + 1]
    for i in range(len(nums)):
        ans[i] = L[i] * R[i]
    return ans


